import React from "react";
import { Section } from "./styles";

export default function AuthorBagde() {
  return (
    <Section>
      <img
        className="image-author"
        src="https://tm.ibxk.com.br/2017/06/22/22100428046161.jpg"
      />

      <div>
        <h2>Almir Santos</h2>
        <p>Dev Front-End</p>
      </div>
    </Section>
  );
}
